import React from "react";

const AdminDashboard = () => {
  return (
    <div className="container mt-4">
      <h2>Dashboard Quản Trị</h2>
      <p>Chào mừng Admin! Tại đây bạn có thể xem thống kê doanh thu.</p>
    </div>
  );
};

export default AdminDashboard;
